import React, { Component } from 'react';
//import logo from './logo.svg';
import './CardHeader.css';

class CardHeader extends Component {
  render() {
    return (
      <div className="CardHeader">
         This is the CardHeader
      </div>
    );
  }
}

export default CardHeader;
